import React from 'react';
import css from './legends.module.css';

import Legend from './legend/legend'

const legends = (props) =>{
    let style="";
    if(props.type=="bar"){
        style = css.barlegends
    }
    if(props.type=="donut"){
        style = css.donutlegends
    }
 return(
     <div className={style}>
     <Legend />
     <Legend />
     </div>
 );
}

export default legends;
